import React, { useEffect, useState } from 'react';
import { withRouter } from 'react-router-dom';
import * as feartures from './features.mjs';

function FrontPage() {
  const [cpu, setCpu] = useState('');
  const [gpu, setGpu] = useState('');
  const [ram, setRam] = useState('');
  const submit = withRouter();

  const handleSubmit = (e) => {
    e.preventDefault();
    submit.push({
      pathname: '/result',
      state: { cpu, gpu, ram }
    });
  };

  let id = "inputs";
  return (
      <div className={"App"}>
        <div id={id}>
          <form onSubmit={handleSubmit}>
            <label htmlFor='user_cpu'>User CPU</label><br/>
            <input
                type='text'
                id='user_cpu'
                name='user_cpu'
                placeholder='Enter your CPU here'
                value={cpu}
                onChange={(e) => setCpu(e.target.value)}
            />
            <br/>
            <label htmlFor='user_gpu'>User GPU</label><br/>
            <input
                type='text'
                id='user_gpu'
                name='user_gpu'
                placeholder='Enter your CPU here'
                value={gpu}
                onChange={(e) => setGpu(e.target.value)}
            />
            <br/>
            <label htmlFor='user_ram'>User RAM</label><br/>
            <input
                type='text'
                id='user_ram'
                name='user_ram'
                placeholder='Enter your RAM here'
                value={ram}
                onChange={(e) => setRam(e.target.value)}
            />
            <br/>
            <input type='submit' value='Submit' />
          </form>
        </div>
      </div>
  );
}

export default FrontPage;
